expression = re.compile(rfc._SUBDOMAIN_REGEX)
bad_examples = ['127.0.0.1', '2001:0dg8:0000:0000:0000:ff00:0042:8329', '2', ''
    ]
for bad_example in bad_examples:
    self.assertFalse(bool(expression.fullmatch(bad_example)), msg=
        "Bad ipv4 '{l}' matched regex".format(l=bad_example))
